    [],nt"revision_timestamp": "2015-12-08T21:04:33.220780",nt"name": "namibia-vocational-training-grant-fund",nt"isopen":
    false,nt"url": null,nt"notes": " n        The impact evaluation of the
    Vocational Training Grant Fund (VTGF) subactivity in Namibia uses a random assignment
    design to determine the effects of VTGF-funded scholarships for vocational training
    on recipients' training and labor market outcomes, such as employment and wages.
    Under this design, eligible applicants to each VTGF-funded training in which the
    number of applications exceeded the number of available slots were randomly assigned
    by the training provider either to a group that was offered a VTGF scholarship (treatment
    group) or one that was not (control group). The treatment and control groups for
    each training are expected to be equivalent, on average, except for the offer of
    VTGF funding. Therefore, differences in the outcomes of the treatment and control
    groups at some time after the training period (which, in this evaluation, will be
    one year after the end of training) can be attributed to the impact of the VTGF
    funding. The data provided in this package are from the baseline survey of eligible
    applicants to VTGF-funded trainings.n      ",nt"license_title": "License Not
